import React from "react";
import { useNavigate } from "react-router-dom";
import "../MenuPrincipal.css";

export default function MenuPrincipal() {
  const navigate = useNavigate();

  return (
    <div className="menu-general">
      {/* Fondo izquierda */}
      <div
        className="menu-fondo"
        style={{
          backgroundImage: `url(${process.env.PUBLIC_URL + '/ELEAM.png'})`,
        }}
      ></div>

      {/* Panel derecho */}
      <div className="menu-panel">
        {/* Banner superior con logo */}
        <div className="menu-banner">
          <div className="menu-logo"
          style={{ backgroundImage: "url('/image.png')" }}></div>
            <span className="menu-titulo">Red ELEAM</span>
          </div>
        </div>

        {/* Texto de bienvenida */}
        <div className="menu-texto">
          <h1>Te damos la bienvenida!</h1>
          <p>Seleccione el módulo al que desea ingresar</p>
        </div>

        {/* Lista de botones */}
        <div className="menu-scroll">
          <div className="menu-botones">
            <button onClick={() => navigate("/ficha-clinica")}>
              FICHA CLÍNICA
            </button>
            <button onClick={() => navigate("/signos-vitales")}>
              SIGNOS VITALES
            </button>
            <button onClick={() => navigate("/parametros-clinicos")}>
              PARÁMETROS CLÍNICOS
            </button>
            <button onClick={() => navigate("/gestion-personal")}>
              GESTIÓN DE PERSONAL
            </button>
            <button onClick={() => navigate("/medicamentos")}>
              MEDICAMENTOS
            </button>
            <button onClick={() => navigate("/liquidacion-pagos")}>
              LIQUIDACIÓN Y PAGOS
            </button>
          </div>
        </div>
      </div>
    );
}
